import octiconSvg from "assets/img/octicon";

const RepoItem = () => {
  return (
    <div className="repo-item">
      <div className="repo-item__icon">
        <img src={octiconSvg} alt="" />
      </div>
      <div className="repo-item__info">
        <div className="repo-item__name"></div>
        <div className="repo-item__topics"></div>
        <div className="repo-item__about"></div>
      </div>
    </div>
  );
};

export default RepoItem;
